import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import Item from './Item.js';


class List extends Component {

    static defaultProps = {
        content: "",
        itemArr: []
    }

    render() {
        var listEntries = this.props.entries;

        function generateLine(item) {
            return <button key={item.key}>{item.text}</button>
        }

        var listItems = listEntries.map(generateLine);
    }
}

export default List;
